Góp ý lần tới nên gói kỹ hơn xíu cho khách hàng nhé','Giao hàng tiêu chuẩn. Tuy ko có chống sốc nhưng may mắn sách ko hề hấn gì. Hi vọng có trải nghiệm tốt khi đọc cuốn sách này','Tiki ship nhanh khỏi phải bàn rồi, còn về nội dung cuốn sách thì mình thấy khá là dễ hiểu, nhìn chung là đủ sâu với một cuốn sách hơn 400 trang, phù hợp với các bạn muốn tìm hiểu về địa chính trị nói chung. Giọng văn của tác giả cuốn hút, đọc không bị buồn ngủ.','sách đẹp. giấy đẹp. giao hàng nhanh.

