bạn sẽ thay đổi cái nhìn về thế giới khi đọc cuốn sách nay.','tiki nhanh quá man từ Hà Nội - Vĩnh Phúc có 2 ngày. Đóng gói mỗi hộp giấy nhưng may mắn không móp bìa. Bìa sách có vài vết bụi nhưng lau xíu sẽ sạch. In ấn thì Nhã Nam đỉnh khỏi bàn. 9.8/10','Khoan hãy đánh giá về nội dung vì nó sẽ tuỳ vào quan điểm mỗi người khi đọc sách, còn về hình thức, phải nói đây là cuốn sách vẻ ngoài khá đẹp mặt, từ form, kích cỡ đến chất lượng giấy đều tuyệt vời, bìa rất đẹp','Cuốn này của Nhã Nam bìa cứng nên khá sang trọng,có lẽ vì thế mà hầu như sale cao cũng đc có 40%,vì đang có mã giảm nên mình mạnh dạn đặt luôn. Cuốn này mà có pb bìa mềm thì tốt. Nội dung khá lí thú về tình hình cục diện thế giới mà k phải ai cũng biết. Giá bìa 210k,nếu làm bìa mềm chắc giá bìa khoảng 160-180k là hợp lí hơn',' Bìa của Nhã Nam thiết kế thì lúc nào cũng đỉnh hết á. Nội dung viết về địa chính trị rất hay, cô đọng, xúc tích, nhưng có nhiều phần mình nghĩ nó chỉ là quan điểm cá nhân của tác giả, chỉ mang tính tham khảo và cần tranh biện thêm. Đọc trong bối cảnh hiện tại thì vô cùng hợp lí, sách không dày nhưng tóm tắt được rất tốt những thông tin quan trọng giải thích cho các sự kiện diễn ra ở hiện tại và được móc nối một cách logic với quá khứ cũng như địa lý, lịch sử của từng khu vực. Nhìn chung sách xịn, có bìa cứng lại bìa ngoài in chữ nổi, hình minh hoạ chỉ là đen trắng thôi nên nhìn không rõ lắm, nhưng... Xem thêm','Mình nhận được sách đúng dự kiến. Sách đóng gói cẩn thận. Bìa cứng, dày dặn in chữ rõ ràng. Mình được nghe lời khen quá nhiều về cuốn sách này nên đã quyết định mua nó. Mng nên có một em trong kệ sách của mình nha ^^','Sách bìa cứng, chất lượng giấy tốt, đáng giá để mua. Các mẹ, chị đừng nhìn chữ TÙ NHÂN và nghĩ nó là sách không phù hợp cho con/em nhá. Vì sách này thật sự là giúp các em mở mang tầm mắt về thế giới và cuộc sống các nước','về giao hàng thì tiki siêu nhanh rồi sách bìa cứng dày dặn giấy cũng đẹp về nội dung mang lại nhiều kiến thức thêm cái là chị shipper dễ thương lắm nên hài lòng còn bọc sách như là màng bọc thực phẩm ý','Giao hàng nhanh 
