Nghe review khá hay nên mới đặttttt','Giao hàng nhanh quá nè! Tối hôm qua đặt hàng ở Huế mà trưa mai đã có hàng giao từ Đà Nẵng vào rồi. Sách xinh lắm, nguyên i bao bì. Nội dung mình nghe review nhiều rồi với cả cũng hứng thú nên chắc chắn sẽ đọc nhanh thôi ^^','Sách của Nhã Nam chưa bao giờ làm mình thất vọng. Hình thức sách rất chỉn chu, có bìa gập rời, các chương sách chia ra theo từng khu vực địa lý lớn trên thế giới kèm bản đồ, đọc rất dễ hiểu. Đặc biệt thích chương Hoa Kỳ, Trung Quốc và Nga, có lẽ do khá gần gũi với mình nên đọc thấy thấm nhất.','Sách đẹp. Nội dung thì chưa đọc nên chưa bình luận. Giao hàng khá nhanh. Nhưng đợt này mình không hài lòng lắm vì kiện hàng của mình có 6 cuốn, kích thước khác nhau nhưng Tiki đóng gói không chèn thêm pe foam, may không có cuốn nào bị va đập móp góc, gáy.','Sách đẹp mua sale giá rẻ. Đóng gói hơi sơ sài nhưng mà hên sách không bị cong góc hay móp gì cả. Nội dung chưa đọc','Khủng hoảng Crimea giữa Nga và Ucraina 2014 có lẽ chính là tiên đề để nhà báo Tim Marshal thực hiện cuốn sách. Cuốn sách là tập hợp một số tiểu luận ngắn về các khu vực trọng yếu trong địa chính trị thế giới từ Nga, Trung quốc, Hoa Kỳ, Tây âu cho đến châu Phi, Nam Mỹ hay Đông bắc á. Đọc nó trong thời điểm chiến tranh Nga - Ucraina thực sự đã nổ ra từ 25/2/2022 là một trải nghiệm thú vị. Một ấn bản tốt về chính trị thế giới của Nhã Nam.','Sách dùng bìa cứng, có thêm áo bìa rời. Về nội dung mình đọc sơ thì rất hay. Thực sự bổ ích về kiến thức, từ yếu điểm địa lý đã ảnh hưởng/ quyết định đến đường lối chính trị đặc trưng không thể thay đổi của các quốc gia đó. Muốn tìm hiểu về thế giới quanh ta, cuốn sách này là cuốn đầu tiên phải đọc','Tiki giao hàng quá tuyệt! Dịch giã thế này vẫn đảm bảo giao trong 02h, đóng gói đâu ra đấy.
